import React, { useState } from "react";

export default function Form() {
  const [todo, setTodo] = useState({});
  const onChange = (e) => {
    setTodo(e.target.value);
  };
  return (
    <div>
      <ul>
        {todo.map((prev) => (
          <li>{prev}</li>
        ))}
      </ul>
      <form>
        <input
          type="text"
          placeholder="Write your ToDO & Enter"
          onChange={onChange}
          value={todo}
        ></input>
        <input type="submit"></input>
      </form>
    </div>
  );
}
